import React, { useState } from "react";
import {
  AppBar,
  Container,
  Menu,
  MenuItem,
  Toolbar,
  Typography,
} from "@mui/material";
import "./index.scss";
import userIcon from "../../assets/icon/user.svg";
import shoppingBag from "../../assets/icon/shopping-bag.svg";
import heart from "../../assets/icon/heart.svg";
import carretDown from "../../assets/icon/carret - down.svg";
import carretDownWhite from "../../assets/icon/carret-down-white.svg";
import { useNavigate } from "react-router-dom";
import { useDispatch } from "react-redux";
import { logoutUser } from "../../redux/features/auth/loginSlice";
import Select from "react-select"; // Import react-select

function AppbarCustom() {
  const navigator = useNavigate();
  const dispatch = useDispatch();
  const [anchorEl, setAnchorEl] = useState(null);
  const [isFocused, setIsFocused] = useState(false); // State untuk menandai fokus
  const [searchValue, setSearchValue] = useState(null); // State untuk menyimpan nilai pencarian
  const [options, setOptions] = useState([]); // State untuk menyimpan opsi pencarian

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    // Dispatch action untuk melakukan logout di Redux state
    dispatch(logoutUser());

    // Hapus data login dari local storage (jika Anda menyimpan token di local storage)
    localStorage.removeItem("token");

    // Redirect ke halaman login
    navigator("/login");
  };

  // Fungsi untuk melakukan pencarian produk
  const handleSearchProducts = (inputValue) => {
    // Simulasikan pencarian produk berdasarkan inputValue
    // Gantilah kode berikut dengan logika untuk mengambil data produk dari API atau sumber data lainnya
    const products = [
      { id: 1, name: "Product 1", image: "image1.jpg", price: 10 },
      { id: 2, name: "Product 2", image: "image2.jpg", price: 15 },
      { id: 3, name: "Product 3", image: "image3.jpg", price: 20 },
    ];

    const filteredProducts = products.filter((product) =>
      product.name.toLowerCase().includes(inputValue.toLowerCase())
    );

    // Ubah data produk menjadi opsi untuk react-select
    const productOptions = filteredProducts.map((product) => ({
      value: product.id,
      label: (
        <div>
          <img
            src={product.image}
            alt={product.name}
            style={{ width: "50px" }}
          />
          <span>{product.name}</span>
          <span>Price: ${product.price}</span>
        </div>
      ),
    }));

    // Set opsi produk ke state options
    setOptions(productOptions);
  };

  return (
    <div>
      {" "}
      <AppBar
        position="static"
        elevation={0}
        style={{ backgroundColor: "#FFF", color: "#000" }}
      >
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}></Typography>
          <div className="content-wrapper">
            {isFocused ? ( // Tampilkan react-select saat dalam keadaan fokus
              <Select
                options={options}
                placeholder="Search"
                isClearable
                isSearchable
                onInputChange={handleSearchProducts} // Panggil fungsi pencarian saat input berubah
                onChange={(selectedOption) => {
                  setSearchValue(selectedOption); // Simpan nilai hasil pencarian ke state searchValue
                }}
                value={searchValue} // Atur nilai value berdasarkan searchValue
                styles={{
                  control: (provided) => ({
                    ...provided,
                    width: "521px",
                    height: "57px",
                    borderRadius: "9px",
                    background: "#FFF",
                    boxShadow: "0px 4px 4px 0px rgba(0, 0, 0, 0.10)",
                    outline: "none",
                  }),
                  // style lainnya sesuaikan dengan kebutuhan Anda
                }}
              />
            ) : (
              // Tampilkan TextField saat tidak dalam keadaan fokus
              <div className="search-input">
                <input
                  type="text"
                  placeholder="Search"
                  onFocus={() => setIsFocused(true)}
                  onBlur={() => setIsFocused(false)}
                  className="text-field"
                />
                <button className="custom-button">
                  <img src={searchIcon} alt="search" />
                </button>
              </div>
            )}
            <div>
              <img src={heart} alt="heart" />
            </div>
            <div>
              <img src={shoppingBag} alt="shopping bag" />
            </div>
            <div onClick={handleMenuOpen}>
              <img src={userIcon} alt="user" />
              <img src={carretDown} alt="carret" />
            </div>
          </div>
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleMenuClose}
            anchorOrigin={{
              vertical: "top",
              horizontal: "right",
            }}
            transformOrigin={{
              vertical: "top",
              horizontal: "right",
            }}
          >
            <MenuItem onClick={handleLogout}>Logout</MenuItem>
          </Menu>
        </Toolbar>
      </AppBar>
      <div className="header">
        <Container style={{ maxWidth: "1300px" }}>
          <div className="content">
            <span>BELANJA</span>
            <img src={carretDownWhite} alt="carret" />
          </div>
        </Container>
      </div>
    </div>
  );
}

export default AppbarCustom;
